import React, { useState } from "react";
import "../../Styles/Shared/NavbarResp.scss";
import logo from "../../Assets/svg/logo.svg";
import SearchIcon from "@material-ui/icons/Search";
import ExpandMoreIcon from "@material-ui/icons/ExpandMore";
import { Link } from "react-router-dom";

function NavbarResp() {
  const [showAbout, setShowAbout] = useState(false);
  const [showProduct, setShowProduct] = useState(false);
  const [showServices, setShowServices] = useState(false);
  const [showResources, setShowResources] = useState(false);
  return (
    <div className='navbarResp'>
      <div className='navbarResp__logo'>
        <img src={logo} alt='' />
        <h1>BattleGames</h1>
      </div>
      <div className='navbarResp__content'>
        <h4 onClick={() => setShowAbout(!showAbout)}>Home</h4>

        <h4 onClick={() => setShowProduct(!showProduct)}>
          Games <ExpandMoreIcon />
        </h4>

        <h4 onClick={() => setShowServices(!showServices)}>Shop</h4>

        <h4>Career</h4>
        <h4 onClick={() => setShowResources(!showResources)}>
          About <ExpandMoreIcon />
        </h4>

        <h4>
          <Link to='/investors'>Blog</Link>
        </h4>
        <h4>Support</h4>
      </div>
    </div>
  );
}

export default NavbarResp;
